import { Layout, Menu, List, Avatar, Space } from "antd";
import {
  UserOutlined,
  SettingOutlined,
  InboxOutlined,
  SnippetsOutlined,
  IdcardOutlined,
  DollarCircleOutlined,
  TeamOutlined,
  SolutionOutlined,
  CalendarOutlined,
  HomeOutlined,
  CloudUploadOutlined,
} from "@ant-design/icons";

import { useSelector } from "react-redux";

const { Sider } = Layout;

const Head = ({ menu, setMenu, role }) => {
  const { currentSession } = useSelector((store) => store.session);
  const data = [
    {
      title: currentSession.firstname,
    },
  ];
  return (
    <Sider
      breakpoint="lg"
      collapsedWidth="0"
      onBreakpoint={(broken) => {
        console.log(broken);
      }}
      onCollapse={(collapsed, type) => {
        console.log(collapsed, type);
      }}
    >
      <div className="logo">
        <h2> Cluuf </h2>
        <List
          style={{ padding: 10, color: "#FFFFFF" }}
          itemLayout="horizontal"
          dataSource={data}
          renderItem={(item) => (
            <List.Item>
              <List.Item.Meta
                avatar={<Avatar src={currentSession.avatar} />}
                title={
                  <>
                    <p style={{ color: "#FFFFFF" }}>
                      {item.title} <br />
                      <Space>
                        <small>
                          <a href="#!" onClick={() => setMenu(11)}>
                            Mi Perfil
                          </a>
                        </small>
                        <small>
                          <a href="login/goldgym">Cerrar Sesión</a>
                        </small>
                      </Space>
                    </p>
                  </>
                }
              />
            </List.Item>
          )}
        />
      </div>
      {role === "ADMIN" && (
        <Menu theme="dark" mode="inline" defaultSelectedKeys={[menu]}>
          <Menu.Item onClick={() => setMenu(1)} key="1" icon={<HomeOutlined />}>
            Inicio
          </Menu.Item>
          <Menu.Item onClick={() => setMenu(2)} key="2" icon={<TeamOutlined />}>
            Clientes
          </Menu.Item>

          <Menu.Item onClick={() => setMenu(4)} key="4" icon={<InboxOutlined />}>
            Paquetes
          </Menu.Item>
          <Menu.Item onClick={() => setMenu(5)} key="5" icon={<SnippetsOutlined />}>
            Planes
          </Menu.Item>
          <Menu.Item onClick={() => setMenu(6)} key="6" icon={<IdcardOutlined />}>
            Aplicaciones
          </Menu.Item>
          <Menu.Item onClick={() => setMenu(7)} key="7" icon={<DollarCircleOutlined />}>
            Transacciones
          </Menu.Item>
          <Menu.Item onClick={() => setMenu(8)} key="8" icon={<SolutionOutlined />}>
            Invitados
          </Menu.Item>
          <Menu.Item onClick={() => setMenu(9)} key="9" icon={<CalendarOutlined />}>
            Calendario
          </Menu.Item>
          <Menu.Item onClick={() => setMenu(10)} key="10" icon={<SettingOutlined />}>
            Instance
          </Menu.Item>
          <Menu.Item onClick={() => setMenu(11)} key="11" icon={<UserOutlined />}>
            Profile
          </Menu.Item>
          <Menu.Item onClick={() => setMenu(12)} key="" icon={<CloudUploadOutlined />}>
            Bucket
          </Menu.Item>
          <Menu.Item onClick={() => setMenu(3)} key="3" icon={<UserOutlined />}>
            Maestro
          </Menu.Item>
        </Menu>
      )}
      {role === "USER" && (
        <Menu theme="dark" mode="inline" defaultSelectedKeys={[menu]}>
          <Menu.Item onClick={() => setMenu(1)} key="1" icon={<UserOutlined />}>
            Mi profile
          </Menu.Item>
        </Menu>
      )}
    </Sider>
  );
};

export default Head;
